import React from 'react';
import RocketCard from "../RocketCard";
import {Container} from './styles'

const RocketLayout = () => {


  const [rocket, setRocket] = useState([])

   useEffect(() => {
     getRocketsInfo().then((data) => setRocket(data));
   }, []);



  return (
    <Container>
      <RocketCard/>
      <RocketCard/>
      <RocketCard/>
    </Container>
  );
};

export default RocketLayout;
